import { Audioset } from "./Audioset";

export const EmptyAudioset: Audioset = {
  type: "audioset",
  id: "none",
  meta: {
    title: "",
    description: "",
    path: "",
    parent_path: "",
    logo_url: "",
    readme: "",
  },
  visuals: {
    mode: "map",
  },
  tracks: [],
  clips: [],
  index: {
    clipById: {},
    trackById: {},
    clipIdsOfTrack: {},
    trackIdOfClip: {},
  },
};
